import './App.css';

function App() {
  return (
    <div className="App">
     <ul>
       <li>css</li>
       <li>html</li>
       <li>js</li>
       <li>react</li>
     </ul>
    </div>
  );
}
function Header() {
  return (
      <div className="Header">
        <a>Home</a>
        <a>News Feed</a>
        <a>Messages</a>
      </div>
  );
}

export default App;
